
// Burada Base64 font değişkeni olacak (3. parçada gelecek)
const notoSansNormal=""
const notoSansBold=""
// Excel verisi
let excelData = [];
const { jsPDF } = window.jspdf;

// === Dosya yükleme ===
document.getElementById('uploadArea').addEventListener('click', () => document.getElementById('fileInput').click());
document.getElementById('fileInput').addEventListener('change', handleFile);
document.getElementById('uploadArea').addEventListener('dragover', e => { e.preventDefault(); e.currentTarget.classList.add('dragover'); });
document.getElementById('uploadArea').addEventListener('dragleave', e => e.currentTarget.classList.remove('dragover'));
document.getElementById('uploadArea').addEventListener('drop', e => {
    e.preventDefault(); e.currentTarget.classList.remove('dragover');
    if (e.dataTransfer.files.length > 0) handleFile({ target: { files: e.dataTransfer.files } });
});

function handleFile(event) {
    const file = event.target.files[0];
    if (!file) return;
    if (!file.name.match(/\.(xlsx|xls)$/)) return showStatus('Geçerli bir Excel dosyası seçin', 'error');

    const reader = new FileReader();
    reader.onload = e => {
        try {
            const workbook = XLSX.read(e.target.result, { type: 'binary' });
            const sheetName = workbook.SheetNames[0];
            const jsonData = XLSX.utils.sheet_to_json(workbook.Sheets[sheetName], { header: 1 });
            if (jsonData.length < 2) return showStatus('Yeterli veri yok', 'error');
            processExcelData(jsonData);
            showStatus('Dosya yüklendi', 'success');
        } catch (err) { showStatus('Dosya okunamadı', 'error'); }
    };
    reader.readAsBinaryString(file);
}

function processExcelData(jsonData) {
    excelData = jsonData.slice(1).map(row => ({
        cariKod: row[0] || '',
        unvan: row[1] || '',
        adres: row[2] || '',
        adres2: row[3] || '',
        ilce: row[4] || '',
        il: row[5] || '',
        vergiDairesi: row[7] || '',
        vergiNo: row[8] || '',
        borc: row[10] || 0
    })).filter(r => r.cariKod);
    updateTable();
    document.getElementById('dataSection').style.display = 'block';
    document.getElementById('recordCount').textContent = excelData.length;
}

function updateTable() {
    const tbody = document.getElementById('tableBody'); tbody.innerHTML = '';
    excelData.forEach((d, i) => {
        const tr = document.createElement('tr');
        tr.innerHTML = `<td>${d.cariKod}</td><td>${d.unvan}</td><td>${d.adres} ${d.adres2}</td>
        <td>${d.ilce}</td><td>${d.il}</td><td>${formatMoney(d.borc)} TL</td>
        <td><button class="btn btn-primary" onclick="generateSinglePDF(${i})">📄 PDF İndir</button></td>`;
        tbody.appendChild(tr);
    });
}

function formatMoney(amount) {
    if (!amount || isNaN(amount)) return '0,00';
    return parseFloat(amount).toFixed(2).replace(/\d(?=(\d{3})+\.)/g, '$&.').replace('.', ',');
}

function numberToWords(amount) {
    if (!amount || isNaN(amount)) return 'Sıfır TL';
    const num = parseFloat(amount), lira = Math.floor(num), kurus = Math.round((num - lira) * 100);
    const ones = ['', 'bir', 'iki', 'üç', 'dört', 'beş', 'altı', 'yedi', 'sekiz', 'dokuz'];
    const tens = ['', '', 'yirmi', 'otuz', 'kırk', 'elli', 'altmış', 'yetmiş', 'seksen', 'doksan'];
    let res = '';
    if (lira >= 1000) res += (Math.floor(lira/1000)===1?'bin':ones[Math.floor(lira/1000)]+' bin');
    const rem = lira%1000;
    if (rem >= 100) res += (Math.floor(rem/100)===1?'yüz':ones[Math.floor(rem/100)]+' yüz');
    const lt = rem%100;
    if (lt >= 10) { res += ' ' + tens[Math.floor(lt/10)]; if (lt%10>0) res += ' ' + ones[lt%10]; }
    else if (lt > 0) res += ' ' + ones[lt];
    res += ' TL';
    if (kurus > 0) res += ' ' + (kurus<10?ones[kurus]:tens[Math.floor(kurus/10)]+(kurus%10>0?' '+ones[kurus%10]:''))+' kuruş';
    return res.trim();
}

function createPDF(data) {
   const doc = new jsPDF('p', 'mm', 'a4');

    // Regular ve Bold fontları ekle
    doc.addFileToVFS("NotoSans-Regular.ttf", notoSansNormal);
    doc.addFont("NotoSans-Regular.ttf", "NotoSans", "normal");

    doc.addFileToVFS("NotoSans-Bold.ttf", notoSansBold);
    doc.addFont("NotoSans-Bold.ttf", "NotoSans", "bold");

    doc.setFont("NotoSans", "normal"); // Varsayılan

    const pageWidth = doc.internal.pageSize.width;
    const margin = 15;
    const today = new Date().toLocaleDateString('tr-TR');

    // Başlık kısmı
    doc.setFontSize(12);
    doc.text('SEVAL', margin, 15);

    doc.setFontSize(14);
    doc.text('MUTABAKAT MEKTUBU', pageWidth / 2, 25, { align: 'center' });

    doc.setFontSize(10);
    doc.text(today, pageWidth - margin, 25, { align: 'right' });

    let yPos = 40;

    // Cari bilgiler
    doc.setFontSize(10);
    doc.text(`Cari Kodu: ${data.cariKod}`, margin, yPos);
    yPos += 5;
    doc.text(`Unvan: ${data.unvan}`, margin, yPos);
    yPos += 5;
    doc.text(`Vergi Dairesi: ${data.vergiDairesi}`, margin, yPos);
    yPos += 5;
    doc.text(`Vergi No: ${data.vergiNo}`, margin, yPos);
    yPos += 5;
    doc.text(`Adres: ${data.adres} ${data.adres2}`, margin, yPos);
    yPos += 5;
    doc.text(`İlçe: ${data.ilce}`, margin, yPos);
    yPos += 5;
    doc.text(`İl: ${data.il}`, margin, yPos);

    // Hitap
    yPos += 10;
    doc.text(`Sayın ${data.unvan}`, margin, yPos);

    // Açıklama
    yPos += 8;
    const intro = `Şirketimiz nezdindeki cari hesabınız ${today} tarihi itibari ile aşağıdaki gibidir:`;
    const introLines = doc.splitTextToSize(intro, pageWidth - 2 * margin);
    doc.text(introLines, margin, yPos);
    yPos += introLines.length * 5;

    // Borç bakiyesi
    const borcValue = parseFloat((data.borc + '').replace(/\./g, '').replace(',', '.')) || 0;
    doc.setFont(undefined, 'bold');
    doc.text(`${formatMoney(borcValue)} TL (${numberToWords(borcValue)})`, margin, yPos);
    doc.setFont(undefined, 'normal');

    // Kapanış
    yPos += 8;
    const closing = `Mutabık olup olmadığınızı gösteren bölümü doldurup imzalayarak 0212-651 72 69 numaralı faxa (mutabık değilsek ekstrenizle beraber) bildirmenizi rica ederiz.`;
    const closingLines = doc.splitTextToSize(closing, pageWidth - 2 * margin);
    doc.text(closingLines, margin, yPos);

    return doc;
}

function generateSinglePDF(index) {
    const doc = createPDF(excelData[index]);
    doc.save(`${excelData[index].cariKod}_mutabakat.pdf`);
}

async function downloadAllPDFs() {
    const zip = new JSZip();
    const progressBar = document.getElementById('progressBar'), fill = document.getElementById('progressFill');
    progressBar.style.display = 'block';
    for (let i=0;i<excelData.length;i++) {
        const pdfBlob = createPDF(excelData[i]).output('blob');
        zip.file(`${excelData[i].cariKod}_mutabakat.pdf`, pdfBlob);
        fill.style.width = ((i+1)/excelData.length*100)+'%';
        await new Promise(r=>setTimeout(r,10));
    }
    const blob = await zip.generateAsync({type:'blob'});
    const url = URL.createObjectURL(blob), a = document.createElement('a');
    a.href=url; a.download='mutabakatlar.zip'; a.click(); URL.revokeObjectURL(url);
    progressBar.style.display = 'none';
}

function loadNewFile() {
    document.getElementById('dataSection').style.display='none';
    document.getElementById('fileInput').value=''; excelData=[];
}

function showStatus(msg,type){
    const el=document.getElementById('statusMessage');
    el.textContent=msg; el.className='status-message status-'+type; el.style.display='block';
    if(type==='success') setTimeout(()=>el.style.display='none',3000);
}
